        </div>

      <table style={{border: '1px solid gray', width: '100%', height: 300}}>
        <tr>
          <th>MARKET</th>
          <th>TIME</th>
          <th>PRICE</th>
          <th>AMOUNT</th>
          <th>SIDE</th>
          <th>STATUS</th>
